column13:
Comunicação e compreensão por parte dos superiores;
A forma como a contribuição financeira é cobrada é desconfortável;
Há um favoritismo veladíssimo e as opiniões só são valorizadas por uma quantia específica de membros. 

Seria importante trabalhar melhor a cultura de respeito e escuta dentro da liga. Todo mundo devia ter o mesmo espaço pra falar e ser levado a sério, independente de gênero, cargo ou tempo de casa.
